import './Exercise.scss';


function deleteItem(props) {
  console.log(props.id);

  let url = `http://localhost:3000/workouts/${ props.id }`;
  console.log(url);

  fetch(url, { method: 'DELETE' });
  window.location.reload(false);
}

function editItem(props) {
  console.log("edit");
}

function Exercise( props ) {  
  return (
    <div>
      <div className="Exercise">
        <div class="cell">{ props.id }</div>
        <div class="cell">{ props.name }</div>
        <div class="cell">{ props.type }</div>
        <div class="cell">{ props.timing }</div>
        <div class="cell">{ props.target} </div>
        <div class="cell"><button onClick={ () => deleteItem(props) }>Delete</button></div>
        <div class="cell"><button onClick={ () => editItem(props) }>Edit</button></div>
      </div>
      <div className="Exercise">
        <form action="http://localhost:3000/workouts" method="POST" target="_blank" >
          <input class="cell" type="text" id="id" name="id" placeholder={ props.id } /> 
          <input class="cell"type="text" id="name" name="name" placeholder={ props.name } />
          <input class="cell"type="text" id="type" name="type" placeholder={ props.type } />
          <input class="cell"type="text" id="timing" name="timing" placeholder={ props.timing } />
          <input class="cell"type="text" id="target" name="target" placeholder={props.target } />
          <input class="cell"type="submit" placeholder="Submit" />
          <div class="cell"></div>
        </form> 
      </div>
      <br></br>
    </div>
  );
}

export default Exercise;
